    [],nt"num_tags": 4,nt"name": "narrative-report-bombay-hook-national-wildlife-refuge-january-april-1959",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Bombay Hook NWR
    outlines Refuge accomplishments from January through April of 1959. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, prescribed burning,
    and wildfires. Resource management is outlined; topics include timber removal. A
    progress report on field investigations and applied research is also provided. The
    public relations section of the report describes recreational uses and Refuge visitors.
    Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
